import React from "react";
import "./Weather.css";

export default function Weather() {
  return (
    <div className="weather">
      <h1>Nottingham</h1>
      <ul>
        <li>Monday 19 May 10:00</li>
        <li>Sunny with some clouds</li>
      </ul>
    </div>
  );
}
